import React from "react";

export default function Card() {
    return (
        <div className="m-10">
            <div className="card m-3" style={{ width: "18rem", maxHeight: "360px" }}>
                <img src="https://media-cdn.tripadvisor.com/media/photo-s/0b/da/61/df/main-order-1-farmhouse.jpg" className="card-img-top" alt="..." />
                <div className="card-body m-4">
                    <h5 className="card-title">Card title</h5>
                    <p className="card-text">This is some imporatant text</p>
                    <div className="container ">
                        <select className="m-2 h-100  bg-success rounded">
                            {Array.from(Array(6), (e, i) => {
                                return (
                                    <option key={i + 1} value={i + 1}>
                                        {i + 1}
                                    </option>
                                );
                            })}
                        </select>
                        <select className="m-2 h-100  bg-success rounded">
                            <option value={"half"}>half</option>
                            <option value={"half"}>full</option>
                        </select>
                        <div className="d-inline h-100 fs-5">Total Price</div>
                    </div>
                </div>
            </div>
        </div>
    );
}
